import React from "react";
import "./Header.scss";
import logo from "../../Logo_ML@2x.png.png";

function Header() {
  return (
    <div className="header">
      <img className="header__logo" src={logo} alt="Amazon Clone Logo" />
    </div>
  );
}

export default Header;
